&lt;p&gt;&lt;strong&gt;Descripci&oacute;n:&lt;/strong&gt;&lt;/p&gt;
&lt;p class=&quot;p1&quot;&gt;La silla Air Pump tiene lo ultimo en tecnologia, ya que se infla en unos segundos y sin usar bomba de aire, ademas de ser muy liviano y amigable con el medio ambiente.&lt;/p&gt;
&lt;p class=&quot;p1&quot;&gt;Esta fabricada con materiales muy resistentes e impermeables que dan la facilidad de usarlo tanto en parques, playas, piscinas, etc. Para que puedas disfrutar de tus actividades favoritas y descansar muy comodamente.&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Caracter&iacute;sticas:&lt;/strong&gt;&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;Adecuado para uso en interiores y exteriores como piscinas, parques y playa.&lt;/li&gt;
&lt;li&gt;Funciona como flotador.&lt;/li&gt;
&lt;li&gt;Impermeable.&lt;/li&gt;
&lt;li&gt;F&aacute;cil de inflar en segundos.&lt;/li&gt;
&lt;li&gt;No necesita bomba de aire.&lt;/li&gt;
&lt;li&gt;Transportable en bolsa.&lt;/li&gt;
&lt;li&gt;Material: nylon/poliester.&lt;/li&gt;
&lt;li&gt;Repelente a la suciedad y humedad, Limpieza facil con agua y jab&oacute;n neutro.&lt;/li&gt;
&lt;li&gt;Tama&ntilde;o inflado: 200x70cm.&lt;/li&gt;
&lt;li&gt;Soporta hasta 200kg (3 personas promedio).&lt;/li&gt;
&lt;li&gt;Colores disponibles: naranja, azul, rosado, negro y rojo.&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;&nbsp;&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;T&eacute;rminos y condiciones:&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;﻿Tiempo de Entrega: 7 d&iacute;as h&aacute;biles a partir de la aprobaci&oacute;n del pago.&lt;br&gt;Garant&iacute;a: 30 d&iacute;as de Garant&iacute;a por Defectos de F&aacute;brica.&lt;/p&gt;
&lt;p&gt;&nbsp;&lt;/p&gt;

